import React from "react";

const ViewInterview  = () => {
    const viewInterviewHandler = (event) => {
        event.preventDefault();
    }

    return (
        <form onSubmit={viewInterviewHandler}>
            <button type="submit">View Interviews</button>
        </form>
    );
};

export default ViewInterview;
